@route('/', method='GET')
def index():
    return template("chatbot.html")


@route("/chat", method='POST')

def chat():
    user_message = request.POST.get('msg')

    if user_message.endswith("!"):
        return yell(user_message)
    if user_message.isspace():
        return nothing(user_message)
    if ":)" in user_message:
        return smile_response(user_message)

    if any(swearing(user_message.lower())):
        return json.dumps({"animation": "crying", "msg": "How rude! Come back to me once you've learned some manners :("})
    
    elif "my name is" in user_message.lower():
        name_slice = user_message[11:]
        return json.dumps({"animation": "excited", "msg": "Nice to meet you {}".format(name_slice)})

    elif "how are you doing" in user_message.lower():
        return json.dumps({"animation": "takeoff", "msg": "I am doing excellent!"})

    elif "favorite language" in user_message.lower():
        return json.dumps({"animation": "ok", "msg": "It's Python, ok?"})

    elif "how old are you" in user_message.lower():
        return json.dumps({"animation": "confused", "msg": "My masters never told me my age"})

    elif "do you have any pets" in user_message.lower():
        return json.dumps({"animation": "dog", "msg": "I have a dog :). Isn't he cute?"})

    elif "where do you live" in user_message.lower():
        return json.dumps({"animation": "no", "msg": "I don't feel comfortable giving out personal info"})

    elif "go away" in user_message.lower():
        return json.dumps({"animation": "heartbroke", "msg": "Too bad. I was hoping we would become friends"})

    elif "tell me a joke" in user_message.lower():
        return json.dumps({"animation": "laughing", "msg": joke()})
    elif "where do you want to go" in user_message.lower():
        return json.dumps({"animation": "giggling", "msg": "You know I can't move!"})
    
    if any(share_list(user_message.upper())): 
        return json.dumps({"animation": "money" , "msg": share_price(user_message)})

def share_price(share_list):
    url = 'https://www.quandl.com/api/v3/datasets/WIKI/{}.json'.format(share_list)
    r = requests.get(url)
    if (r.status_code == 200):
        result = json.loads(r.content)
        data_today = result["dataset"]["data"][0]
        stock_info = {
            "open" : data_today[1],#open
            "high": data_today[2],#high
            "low": data_today[3],#low
            "close": data_today[4], #close
            "volume": data_today[5] #volume
        }
        return json.dumps(stock_info)

